import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route,
} from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <header className='header'>
        <p className='text'>Welcome!</p>
      </header>
      <Routes>
        <Route path="/" element={<Start />} />
      </Routes>
    </BrowserRouter>
  );
}

const Start = () => {
  const [type, setType] = React.useState('name');

  return (
    <div className='App'>
      <div className='main'>
        <div className='typeSelect'> 
          <input type='checkbox' style={{ display:'inline' }} />
          <span>Search by ID</span>
          <input type='checkbox' style={{ display:'inline' }} />
          <span>Search by Name</span>
        </div>
        {type==='name' && <input type='text' className='Input' placeholder='Name of the researcher' />}
        {type==='id' && <input type='text' className='Input' placeholder='ID of the researcher' />}
        <a href='/123'>Let's Start!</a>
      </div>
    </div>
  )
}

export default App;
